function netstate_init(){$.getJSON("https://www.linuxlounge.net/ffda/api.php",function(t){$("#net_state_loading").hide(),$("#net_state_nodes").text(t.nodes),$("#net_state_clients").text(t.clients),rx=t.traffic.rx,tx=t.traffic.tx,rx=Math.round(rx/1024/1024),tx=Math.round(tx/1024/1024),total=rx+tx,$("#net_state_traffic").text(total+" GB / Tag").attr("title","RX: "+rx+" GB / TX: "+tx+" GB")})}
